def determine_winner(test_cases):
    grundy = [[-1] * 15 for _ in range(15)]
    grundy[0][0] = grundy[0][1] = grundy[1][0] = grundy[1][1] = 1

    def move_coin(x, y):
        if x > 1:
            if y > 0:
                yield (x - 2, y - 1)
            if y < 14:
                yield (x - 2, y + 1)
        if y > 1:
            if x > 0:
                yield (x - 1, y - 2)
            if x < 14:
                yield (x + 1, y - 2)

    def get_grundy(x, y):
        if grundy[x][y] != -1:
            return grundy[x][y]
        s = set()
        for (i, j) in move_coin(x, y):
            s.add(get_grundy(i, j))
        mex = 0
        while mex in s:
            mex += 1
        grundy[x][y] = mex
        return mex
    results = []
    for case in test_cases:
        k = case['k']
        coordinates = case['coordinates']
        coins = [[0] * 15 for _ in range(15)]
        for (i, j) in coordinates:
            coins[i - 1][j - 1] = 1 - coins[i - 1][j - 1]
        res = 0
        for i in range(15):
            for j in range(15):
                if coins[i][j]:
                    res ^= get_grundy(i, j)
        results.append('First' if res else 'Second')
    return results

